import { useEffect } from "react";
import { useNavigate } from "react-router-dom";
import styles from "../styles/Success.module.css";

function Success() {
  useEffect(() => {
    const formData = sessionStorage.getItem("formData");

    console.log(formData);
    infoSlots = document.querySelectorAll("td");

    for (const info of infoSlots) {
      const context = info.id;
      info.value = formData.context;
    }
  }, []);
  let navigate = useNavigate();

  function redirectUser() {
    navigate("/");
  }

  return (
    <div>
      <h2 className={styles.heading}>
        You're request has been successfully submitted.
      </h2>
      <div className={styles.information}>
        <table>
          <tbody>
            <tr>
              <th>Name: </th>
              <td id="name"></td>
            </tr>
          </tbody>
        </table>
      </div>
      <button onClick={redirectUser}>Go to home</button>
    </div>
  );
}

export default Success;
